import React from "react";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Dropdown from 'react-bootstrap/Dropdown';
import DropdownButton from 'react-bootstrap/DropdownButton';

import Entrar from "../pages/Entrar";
import rotas from "../rotas";
import './css/NavBar.css'


function NavBar() {
  return (
    <>
      <Navbar bg="primary" variant="dark" className="navbar">
        <Container className="container">
          {/* <DropdownButton className="col-9" id="dropdown-basic-button" title="Cursos">
            <Dropdown.Item href="#/action-1">Português</Dropdown.Item>
            <Dropdown.Item href="#/action-2">Ingles</Dropdown.Item>
            <Dropdown.Item href="#/action-3">Matemática</Dropdown.Item>
          </DropdownButton> */}
          <Nav className="me-auto d-flex col-12">
            <div className="row col-12">
            <Nav.Link href="../pages/Entrar" className="col">Entrar</Nav.Link>
            </div>
            <div>
            <Nav.Link href="../pages/Cadastrar" className="col text-end btn">Cadastre-se</Nav.Link>
            </div>
          </Nav>
        </Container>
      </Navbar>
    </>
  );
}


export default NavBar;
